import React from 'react';
import Card from './Card';


const CardList = ({robot}) => {
    return (
        <div>
            for (item of robot) {
                <Card id={robot[0].id} name={robot[0].name} email={robot[0].email} />
            }
        </div>
    )
}

export default CardList
